import { createApp } from 'vue'
import App from './App.vue'
import router from './router/router'
import MisaButton from './components/MisaButton.vue'
import FontJs from './assets/font/fontawesome-pro-6.1.1-web/js'

const app = createApp(App);
app.use(router);
app.use(FontJs);
app.component("MisaButton",MisaButton);
// app.use(express.static(path.join('/src/assets/font/fontawesome-pro-6.1.1-web/js/all.min.js', "js")));
app.mount('#app');
